以下是一个可以生成按照相反顺序打印从1到N的数字的C++程序:

```c++
#include <iostream>
using namespace std;

int main() {
    int N;
    cout << "请输入一个正整数N(1到100): ";
    cin >> N;

    int numArray[N];
    cout << "请输入N个数字,存储在numArray数组中:" << endl;
    for (int i = 0; i < N; i++) {
        cin >> numArray[i];
    }

    int reverseArray[N];
    cout << "请将numArray数组中的数字按照相反顺序存储在reverseArray数组中:" << endl;
    for (int i = 0; i < N; i++) {
        reverseArray[i] = numArray[i];
    }

    int i = 0;
    int j = N - 1;
    while (i < N && j > 0) {
        cout << reverseArray[j] << " ";
        reverseArray[i] = reverseArray[j];
        j--;
        i++;
    }

    cout << endl;
    return 0;
}
```

这个程序首先会提示用户输入一个正整数N,然后生成N个数字并存储在`numArray`数组中。接着,程序会将`numArray`数组中的数字按照相反顺序存储在`reverseArray`数组中。最后,程序会输出`reverseArray`数组中的所有数字,每两个数字之间用一个空格隔开。

